import './App.css';
import Header from './Header';
import Product from './Product';


function App() {

  return (
    <div className='App'>
      <Header />
      <div className='Products'>
      <Product name="Jeans" price="$500"/>
      <Product name="Kurta" price="$300"/>
      <Product name="Shirt" price="$233 "/>
      </div>
    </div>
  );
}

export default App;
